<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Dynamic Focus Achievement</title>
    <style>
        :root {
            --color-primary: #1a237e;
            --color-accent: #7c4dff;
            --color-text: #1f2937;
            --color-text-secondary: #6b7280;
            --color-background: #ffffff;
            --color-success: #00bfa5;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Arial, sans-serif;
            min-height: 100vh;
            min-width: 100vw;
            height: 100vh;
            width: 100vw;
            display: flex;
            justify-content: center;
            align-items: center;
            overflow: hidden;
        }

        .story-container {
            width: 100vw;
            height: 100vh;
            max-width: 100vw;
            max-height: 100vh;
            aspect-ratio: 9/16;
            border-radius: 0;
            overflow: hidden;
            position: relative;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
        }

        .tree-container {
            position: absolute;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: flex-end;
        }

        #tree-image {
            width: 100vw;
            height: 100vh;
            object-fit: cover;
            position: absolute;
            top: 0;
            left: 0;
            z-index: 0;
            filter: saturate(1.2);
        }

        .achievement-card {
            position: relative;
            z-index: 10;
            background: rgba(255, 255, 255, 0.92);
            backdrop-filter: blur(20px);
            border-radius: 32px;
            padding: 40px;
            text-align: center;
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 16px;
            box-shadow: 0 12px 36px rgba(0, 0, 0, 0.15);
            border: 1px solid rgba(255, 255, 255, 0.3);
        }

        .achievement-icon {
            font-size: 32px;
            margin-bottom: 8px;
        }

        .achievement-title {
            font-size: 24px;
            color: var(--color-primary);
            font-weight: 600;
            letter-spacing: 0.5px;
        }

        .achievement-time {
            font-size: 72px;
            background: linear-gradient(135deg, var(--color-primary), var(--color-accent));
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            font-weight: 800;
            line-height: 1;
            margin: 8px 0;
        }

        .achievement-message {
            font-size: 16px;
            color: var(--color-text-secondary);
            max-width: 240px;
            line-height: 1.4;
        }

        .achievement-footer {
            display: flex;
            justify-content: center;
            align-items: center;
            gap: 12px;
            font-size: 14px;
            margin-top: 12px;
            padding-top: 16px;
            border-top: 1px solid rgba(0, 0, 0, 0.1);
            width: 100%;
        }

        .app-name {
            font-weight: 600;
            color: var(--color-primary);
        }

        .date {
            color: var(--color-text-secondary);
        }
    </style>
</head>
<body>
    <div class="story-container">
        <div class="tree-container">
            <img id="tree-image" src="" alt="Focus Tree" style="display: none;">
        </div>

        <div class="achievement-card">
            <div class="achievement-icon">ðŸŒŸ</div>
            <div class="achievement-title">Focus Achievement</div>
            <div class="achievement-time" id="focus-time">30 Mins</div>
            <div class="achievement-message">Your dedication to focus has helped your tree grow stronger</div>
            <div class="achievement-footer">
                <span class="app-name">questphone.app</span>
                <span class="date" id="current-date">27 October 2025</span>
            </div>
        </div>
    </div>

    <script>
        function updateDate() {
            const date = new Date();
            const options = { day: 'numeric', month: 'long', year: 'numeric' };
            const formatted = date.toLocaleDateString('en-GB', options);
            document.getElementById('current-date').textContent = formatted;
        }

        function injectTree(base64) {
            const img = document.getElementById('tree-image');
            img.src = base64;
            img.style.display = 'block';
        }

        function minutesFocused(minutes) {
            const timeEl = document.getElementById('focus-time');
            
            if (minutes < 60) {
                timeEl.textContent = minutes + ' Mins';
            } else {
                const hours = Math.floor(minutes / 60);
                const mins = minutes % 60;
                if (mins === 0) {
                    timeEl.textContent = hours + ' Hour' + (hours > 1 ? 's' : '');
                } else {
                    timeEl.textContent = hours + 'h ' + mins + 'm';
                }
            }
        }

        function applyTheme(theme) {
            const root = document.documentElement;
            
            root.style.setProperty("--color-primary", theme.primary || "#1a237e");
            root.style.setProperty("--color-accent", theme.secondary || "#7c4dff");
            root.style.setProperty("--color-background", theme.background || "#ffffff");
            root.style.setProperty("--color-text", theme.onBackground || "#1f2937");
            root.style.setProperty("--color-text-secondary", theme.onSurface || "#6b7280");
        }

        updateDate();
        window.injectTree = injectTree;
        window.minutesFocused = minutesFocused;
        window.applyTheme = applyTheme;
